import React from 'react';
import { Switch, Route } from 'react-router-dom';

import LandingPage from './landingpage';
import Projects from './projects';
import Posti from './posti';
import HackathonGOC from './hackathonGOC';
import HackathonAD from './hackathonAD';
import HackathonWK from './hackathonWK';
import HackathonEU from './hackathonEU';
import BetsFriends from './betsFriends';
import Vredestein from './vredestein';
import PCdesign from './pcdesign';
import PCtechnical from './pctechnical';
import PCwork from './pcwork';
import IandE from './iande';
import Tekla from './tekla';

const Main = () => (
  <Switch>
    <Route exact path="/" component={LandingPage}/>
    <Route path="/projects" component={Projects} />
    <Route path="/posti" component={Posti} />
    <Route path="/hackathonGOC" component={HackathonGOC} />
    <Route path="/hackathonAD" component={HackathonAD} />
    <Route path="/hackathonWK" component={HackathonWK} />
    <Route path="/hackathonEU" component={HackathonEU} />
    <Route path="/betsFriends" component={BetsFriends} />
    <Route path="/vredestein" component={Vredestein} />
    <Route path="/pcdesign" component={PCdesign} />
    <Route path="/pctechnical" component={PCtechnical} />
    <Route path="/pcwork" component={PCwork} />
    <Route path="/tekla" component={Tekla} />
    <Route path="/iande" component={IandE} />

  </Switch>
)

export default Main;
